'''
给定一个字符串，找出不含有重复字符的最长子串的长度。

示例：

给定 "abcabcbb" ，没有重复字符的最长子串是 "abc" ，那么长度就是3。

给定 "bbbbb" ，最长的子串就是 "b" ，长度是1。

给定 "pwwkew" ，最长子串是 "wke" ，长度是3。请注意答案必须是一个子串，"pwke" 是 子序列  而不是子串。
'''

'''
思路，先从第一个字符读起，
直到遭遇第一个相同字符，保存这个子串长度为 result。
然后从第二字符读起，直接读长度为 result 的这个子串，那就是 s[index, result]
如果 这个子串有重复字符就不要了 break 掉
如果没有则往后推进，直到遭遇重复字符为止
然后更新 result 
然后从第三个字符读起...

此外，如果子串的末位座标 index + result 大于或等于总长度 length，也就是子串的长度
读 abca 
第一次得到 abc， result = 3
然后变成 [index, index+result]，即 [1,4], 4 >= length，
也就是说，即使新的子串全部不重复，也不会比之前的 result 大，所以不要，直接返回 result
'''

class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if not s:
            return 0

        sub = []             # 无重复子串包含的字符
        length = len(s)      # 最后的位置
        s = list(s)
        count = 0
        result = 0

        while True:

            index = count
            if index + result <= length:
                sub = s[index:index+result]  
            else:
                return result
            while index < length - result:
                if s[index+result] not in sub:
                    if len(sub) != len(set(sub)):
                        break
                    sub.append(s[index+result])
                    index += 1
                else:
                    new = len(set(sub))
                    if new > result:
                        result = new
                    sub.clear()
                    break
            new = len(set(sub))
            if new > result:
                result = new            

            count += 1

        return result

print(Solution().lengthOfLongestSubstring("qrsvbspk"))    
print(Solution().lengthOfLongestSubstring("pwwkew"))    
